// Hardcoded analysis logic (can be replaced with OpenAI)
function analyzeWorkflowFeatures(url, description, name) {
  const features = [];
  const nodeTypes = [];
  const services = [];
  const audience = [];
  let complexity = 'simple';
  let setupTime = 15;

  const text = `${name} ${description} ${url}`.toLowerCase();

  // Analyze features based on keywords
  if (text.includes('slack') || text.includes('notification')) {
    features.push('slack-integration');
    nodeTypes.push('n8n-nodes-base.slack');
    services.push('slack');
  }

  if (text.includes('webhook') || text.includes('api')) {
    features.push('webhook-processing');
    nodeTypes.push('n8n-nodes-base.webhook');
    nodeTypes.push('n8n-nodes-base.httpRequest');
  }

  if (text.includes('ai') || text.includes('openai') || text.includes('gpt')) {
    features.push('ai-integration');
    nodeTypes.push('@n8n/n8n-nodes-langchain.lmChatOpenAi');
    services.push('openai');
    complexity = 'advanced';
    setupTime = 45;
  }

  if (text.includes('email') || text.includes('gmail')) {
    features.push('email-automation');
    nodeTypes.push('n8n-nodes-base.gmail');
    services.push('gmail');
  }

  if (text.includes('google') || text.includes('drive') || text.includes('sheets')) {
    features.push('google-integration');
    nodeTypes.push('n8n-nodes-base.googleDrive');
    nodeTypes.push('n8n-nodes-base.googleSheets');
    services.push('google');
  }

  if (text.includes('schedule') || text.includes('cron')) {
    features.push('scheduling');
    nodeTypes.push('n8n-nodes-base.scheduleTrigger');
  }

  if (text.includes('data') || text.includes('sync') || text.includes('etl')) {
    features.push('data-processing');
    nodeTypes.push('n8n-nodes-base.splitInBatches');
    nodeTypes.push('n8n-nodes-base.merge');
  }

  // Determine target audience
  if (text.includes('marketing') || text.includes('social')) {
    audience.push('marketers');
  }
  if (text.includes('developer') || text.includes('api') || text.includes('webhook')) {
    audience.push('developers');
  }
  if (text.includes('data') || text.includes('analytics') || text.includes('report')) {
    audience.push('analysts');
  }

  // Adjust complexity based on features
  if (features.length > 5) {
    complexity = 'advanced';
    setupTime = 60;
  } else if (features.length > 2) {
    complexity = 'intermediate';
    setupTime = 30;
  }

  return {
    features,
    nodeTypes,
    services,
    audience,
    complexity,
    setupTime
  };
}

